import React, { useState } from "react";
import LoginPage from "./Login";
import Dashboard from "./Dashboard";

export default function Home() {
	const [isSignedIn, setIsSignedIn] = useState(false);

	const handleLogin = () => {
		setIsSignedIn(true);
	};

	return isSignedIn ? (
		<Dashboard />
	) : (
		<LoginPage onSuccessLogin={handleLogin} />
	);
}
